import './App.css';
import logo from './logo.svg';

function App() {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src='./img/drevo.png' />
      </header>
      <nav className="nav">
        <div>
          <a href="">Profile</a>
          </div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
        <div>Settings</div>
      </nav>
      <div className="content">
        Main Content
      </div>
    </div>
  );
}

export default App;
